import React, { useState } from 'react'

const Good = props => <div>{props.good}</div>
const Display2 = props => <div>{props.value}</div>
const Display3 = props => <div>{props.value}</div>

const Button = (props) => (
  <button onClick={props.handleClick}>
    {props.text}
  </button>
)

const App = () => {
  const [value, setValue] = useState(10)

  const [good, setGood] = useState(0)
  const [neutral, setNeutral] = useState(0)
  const [bad, setBad] = useState(0)


  const setToGood= newValue => {
    setValue(newValue)
  }
  const setToValue2 = newValue => {
    setValue(newValue)
  }
  const setToValue3 = newValue => {
    setValue(newValue)
  }

  return (
    <div>
      <Good good={good} />
      <Display2 value={value} />
      <Display3 value={value} />
      <Button handleClick={() => setToGood(good + 1)} text="Good" />
      <Button handleClick={() => setToValue2(0)} text="reset" />
      <Button handleClick={() => setToValue3(value + 1)} text="increment" />
    </div>
  )
}
export default App
